import React from 'react';

function CheckoutProduct({id, image,title, price}) {
    return (
        <div>
            <img src={image} />

            <div className='checkoutProduct_info'>

                <h3> {title}</h3>
                <h3>
                    Rs.
                        <strong>{price}</strong>
                </h3>

            </div>
            <button>Remove from Cart</button>
        </div>
    )
}

export default CheckoutProduct;
